        "title": "GoPro HERO5 + Karma: The Launch in 4K",
        "description": "More than a drone: Karma is an aerial, hand-held and mountable stabilization solution. And yes, it includes a drone! Hollywood in a backpack for $799.\n \nShot 100% on GoPro, including HERO5, HERO5 Session and Karma\n \nHERO5 Black is the most powerful and easy-to-use GoPro ever, thanks to its 4K video, voice control, one-button simplicity, touch display and waterproof design. Add video stabilization, stereo audio, GPS and auto-uploading of your photos and videos to the cloud and you've got a ton of GoPro for $399. \n\nHERO5 Session shares the convenient size and one button simplicity of the original HERO Sessionbut with massive performance gains like 4K video, 10MP photos, video stabilization, improved low light performance and voice control. It's waterproof without a housing to 30 feet and can auto-upload your photos and videos to the cloud. HERO5 Session may be the ultimate combination of performance and small size.\n \nKarma is so much more than a drone. It captures amazingly smooth GoPro footage in the air, handheld, and mounted to your favorite gear. Compact and ultra portable, the Karma Drone folds to fit into its own lightweight case. The game-style controller with an integrated touch display makes Karma easy and fun to fly. The included camera stabilizer can be removed from the drone and attached to the included Karma Grip for ultra steady professional-looking handheld and gear-mounted footage. Hollywood-caliber stabilization in a backpack you can wear during almost any activity...for $799.\n \nA family road trip.\nA snowy adventure. \nA tropical destination. \nA performance on the biggest stage of your life. \n\nMusic\nJai Wolf \"Indian Summer\"\nLink to Buy: goo.gl/BVQz3c\n\nFeatured Characters:\nMusic: \nAmsterdam, Netherlands at Lowlands Festival\nWolfmother\n\nSki:\nPortillo, Chile\nLynsey Dyer, Julia Mancuso, and Jamie Anderson\n\nSnowboard:\nJackson Hole, Wyoming\nTravis Rice\nBryan Iguchi\n\nMoto: \nItalian Dolomites\nStefan Lantschner and Josef Pichler\n\nVan Life:\nNeah Bay, Washington & Sedona, AZ & Lake Tahoe, CA\nMorgan Brechler, Hadlie Brechler, and Jared Marvel\n\nMountain Bike: \nSkibowl, Oregon\nChris Van Dine, Kurt Voreis, Dennis Youroshek, and Luke Strobel\n\nAsia Pacific: \nSri Lanka & Thailand\nBrandon Li, Kobe Lee, Renee Lusano, and Ishita Malaviya\n\nMexico: \nMexico City, Mexico\nFrancisco ‚ÄúPaco‚Äù Trad and Tatiana Serur\n\nSurf: \nBali\nLakey Peterson, Alana Blanchard, Johanne Defane, and Bianca Buitendag\n\nSPECIAL THANKS:\nMorgan Brechler and family\nWolfmother: http://www.wolfmother.com/\nLowlands Festival: http://lowlands.nl/en/\nBrandon Li and Kobe Lee\nWindup Films\nCorrino \nSki Portillo\nChris Van Dine\n\nIn loving memory of Kelly McGarry, Erik Roner & Uli Emanuele.\n\nFor more from GoPro:\nWeb: https://goo.gl/arSrCk\nFacebook: https://www.facebook.com/gopro\nTwitter: https://twitter.com/gopro\nInstagram: https://instagram.com/gopro\nTumblr: http://gopro.tumblr.com/\nPinterest: http://www.pinterest.com/gopro   \nVine: https://goo.gl/m3nQz7\n#GoPro",
